measurements.description:
Eight shapely, richly colored and boldly patterned Harlequin flowers with high-contrast white lips arranged well on one arching, 81cm inflorescence;
	sepals and petals largely bright, deep fuchsia leaving a white picotee along margins and small snow white patches basally;
	lip snow white blushed lightly and speckled with dark fuchsia purple in throat over and around calli;
	column white, fuchsia blushed distally, darker fuchsia spot on anther cap; substance average; texture matte.
